Ricche... Sfondate (ATV Entertainment) [DVDRip]

Anita Armani, Christina Bella, Katy Parker, Lara Holmes, Mandy Bright

Questo film racconta la storia della prorompente Lara che riesce a farsi un milionario. Nel locale notturno della sua amica Susi, una spogliarellista bi-sex, conosce il Guru Robert. Vedrete come l'affascinante Robert si abbandona nelle braccia dell'avvenente Lara mentre il socio di Robert, Paul, si scopa la cameriera Jenny e... nel frattempo Butler porta Pamela al massimo godimento...

